import React, { useState } from 'react'
import styled from 'styled-components'

import MenuNavItem from './MenuNavItem.js'

const FixedWrapper = styled.header`
    position: -webkit-sticky;
    position: sticky;
    top: 8rem;
    width: 100%;
    height: 6rem;
    display: flex;
    justify-content: center;
    border-bottom: 2px solid var(--color-border);
`
const Ul = styled.ul`
    display: flex;
    align-items: center;
    justify-content: center;
    height: 100%;
    width: 70%;
`
const Li = styled.li`
  display: flex;
  height: 100%;
  width: 50%;
  padding: 0;
  align-items: center;
  justify-content: center;
  font-size: 1.4rem;
  font-weight: 700;
  color: var(--color-title);
  text-transform: uppercase;
`

const MenuNavbar = () => {
    return(
        <FixedWrapper>
            <Ul>
                <Li> Deliver to: & </Li>
                <Li> 524 E. Foothill Blvd. </Li>
                <MenuNavItem> Drinks </MenuNavItem>
            </Ul>
        </FixedWrapper>
    )
}

export default MenuNavbar
